import React, { Component } from "react";
import Header from "./Header";
import Score from "./score/Score";
import HumanScore from "./score/HumanScore";
import ComputerScore from "./score/ComputerScore";
import GameOptions from "./gameOptions/GameOptions";
import Rock from "./gameOptions/Rock";
import Paper from "./gameOptions/Paper";
import Scissors from "./gameOptions/Scissors";

export default class Game extends Component {
  render() {
    return (
      <div className="wrapper">
        <Header></Header>
        <div className="container">
          <Score>
            <HumanScore></HumanScore>

            <ComputerScore></ComputerScore>
          </Score>

          {/* <GameOptions>
          <Rock></Rock>

          <Paper></Paper>

          <Scissors></Scissors>
        </GameOptions> */}
        </div>
      </div>
    );
  }
}
